import "./heroImgStyle.css"
import IntroImg from "../assets/heroImage.png"

const HeroImg = () => {
    return(
        <div className="hero">
            <div className="mask">
                <img className="into-img"
                src={IntroImg} alt="IntroImg" />
            </div>
        </div>
    )
}
